import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import SideMenu from './defultComponent/sidebar';
import TablesIndex from './modules/table/components/index.component';
import TablesView from './modules/table/components/view.component';
import TablesEdit from './modules/table/components/edit.component';
import MenusIndex from './modules/menu/components/index.component';
import MenusView from './modules/menu/components/view.component';
import MenusEdit from './modules/menu/components/edit.component';
import CustomersIndex from './modules/customers/components/index.component';
import CustomersView from './modules/customers/components/view.component';
import CustomersEdit from './modules/customers/components/edit.component';
import MenusIreservationndex from './modules/customers/components/reservation.component';
import NaveMenu from './defultComponent/naveber';

class App extends React.Component {
  constructor(props, state) {
    super(props);

    console.log("====", props, state);
  }
  render() {
    return (
        <BrowserRouter >
          <div style={{
            height: "100vh",
            border: "2px solid black", 
            padding: "25px", 
            background: "url('https://eatdrink.ca/wp-content/uploads/2018/05/beer-main.png')", 
            backgroundRepeat: "no-repeat", 
            backgroundSize: "cover",
            // backgroundPosition: "50% 50%"
          }} >
            <div className="col col-3" >
                <NaveMenu />
              </div>
              <div className="col col-9" style={{ padding: "40px" }}>
                <div style={{ width: "100%" }}>
                  <div className="col col-12">
                    <div className="content-em-1">
                      <div>
                        <Routes>

                          {/* Home */}
                          <Route path='/' />

                          {/* menus */}
                          <Route path='/menus/' element={<MenusIndex />} />
                          <Route path='/menus/:category' element={<MenusIndex />} />
                          <Route path='/menus/:category/:id' element={<MenusView />} />
                          <Route path='/menus/add' element={<MenusEdit />} />

                          {/* tables */}
                          <Route path='/tables/' element={<TablesIndex />} />
                          <Route path='/tables/:id' element={<TablesView />} />
                          <Route path='/tables/add' element={<TablesEdit />} />

                          {/* customers */}
                          <Route path='/customers/' element={<CustomersIndex />} />

                          {/* customers tobeSitted */}

                          <Route path='/customers/tobesitted/' element={<CustomersIndex />} />
                          <Route path='/customers/tobesitted/:name' element={<CustomersView />} />
                          <Route path='/customers/tobesitted/add' element={<CustomersEdit />} />

                          <Route path='/customers/sitting/' element={<CustomersIndex />} />
                          <Route path='/customers/sitting/:name' element={<CustomersView />} />

                          <Route path='/customers/awaitingBill/' element={<CustomersIndex />} />
                          <Route path='/customers/awaitingBill/:name' element={<CustomersView />} />

                          {/* reservation */}
                          <Route path='/customers/sitting/:GroupSeqNo/reservation' element={<MenusIreservationndex />} />

                        </Routes>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
          </div>
        </BrowserRouter>
    )
  }
}

export default App;
